import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header/Header';
import Home from './pages/Home';
import About from './pages/About';
import Admissions from './pages/Admissions';
import Academics from './pages/Academics';
import Contact from './pages/Contact';
import MyAccount from './pages/MyAccount'; // Ensure this path matches the file location
import Profile from './pages/Profile'; // Import Profile page
import Settings from './pages/Settings'; // Import Settings page
import Grades from './pages/Grades'; // Import Grades page
import Logout from './pages/Logout'; // Import Logout page

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/admissions" element={<Admissions />} />
        <Route path="/academics" element={<Academics />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/my-account" element={<MyAccount />} />
        <Route path="/profile" element={<Profile />} /> {/* Add Profile route */}
        <Route path="/settings" element={<Settings />} /> {/* Add Settings route */}
        <Route path="/grades" element={<Grades />} /> {/* Add Grades route */}
        <Route path="/logout" element={<Logout />} /> {/* Add Logout route */}
      </Routes>
    </Router>
  );
}

export default App;
